const MultiStepIndicator = ({ index, changeIndex }) => {
  return (
    <nav>
      <ol className="cd-breadcrumb triangle">
        <li className={ index === 0 ? "current" : "" } onClick={changeIndex(0)}><a href="javascript:;">Seus dados</a></li>
        <li className={ index === 1 ? "current" : "" } onClick={changeIndex(1)}><a href="javascript:;">Planos</a></li>
        <li className={ index === 2 ? "current" : "" } onClick={changeIndex(2)}><a href="javascript:;">Pagamento</a></li>
        {/*<li className="current"><em>Project</em></li>*/ }
      </ol>
    </nav>
  )
}


export default MultiStepIndicator
